import React from "react";
import { FaPlus } from "react-icons/fa";

const BotonAgregar = ({ texto }) => {
    return (
        <button className="btn btn-success d-flex align-items-center gap-2">
            <FaPlus /> {texto}
        </button>
    );
};

export default BotonAgregar;
